column8:
●車載スマートフォンホルダー<BR>
ダッシュボードやフロントガラスに吸盤で貼りつけるだけ<BR>
アーム部は5～9.5cmまで可動し、iPhone6PLUS等の大型液晶スマホでもしっかり固定できます<BR>
もちろんiPhone5等の既存の小型スマホにも対応しております<BR>
<BR>
水平方向360°回転し、縦横自由自在　垂直は約150°程度可動します<BR>
スタイリッシュなデザインでインテリアに溶け込みます
また、車載だけでなく、キッチンやお風呂等でも便利に活用できます<BR>
<BR>
設置方法は簡単!!<BR>
貼りつけ面をきれいに拭いて吸盤をしっかり押しつけてロックレバーを下ろすだけ！<BR>
しっかり吸着してくれます<BR>
スマホを挟む部分はゴム状になっており、大事なスマホを傷つけることもありません<BR>
<BR>
材質：ABS+シリコン<BR>
サイズ(約)：139×60×60mm<BR>
クリップサイズ(約)：50×90mm 厚さ12mm<BR>
カラー：レッド<BR>
重量(約)：85.3g<BR>
製造国：中国<BR>
<BR>
※ダッシュボードの材質や凹凸により設置できない場合がございます。<BR>
<BR>
※ご注意ください※<BR>
